### １次元での例

::: {#149de1e5 .cell execution_count=3}
``` {.julia .cell-code}
using ZigZagBoomerang
using LinearAlgebra
using SparseArrays

# Cauchy分布のポテンシャル関数
ϕ(x) = log(1 + x[1]^2)

# ポテンシャル関数の勾配
∇ϕ(x, i, Γ) = 2x[i] / (1 + x[i]^2)

# 初期値
t0 = 0.0
x0 = [0.0]
θ0 = [1.0]

# ZigZag過程のパラメータ
T = 1000.0  # 総シミュレーション時間

# スパース精度行列（1次元の場合は1x1行列）
Γ = sparse([1], [1], [1.0], 1, 1)

# ZigZag過程の設定
Z = ZigZag(Γ, zeros(1))

# リジェクションバウンド（必要に応じて調整）
c = [1.0]

# ZigZag過程の実行
trace, (tT, xT, θT), (acc, num) = ZigZagBoomerang.spdmp(∇ϕ, t0, x0, θ0, T, c, Z, Γ; adapt=false)

# 軌跡の離散化とサンプリング
dt = 0.1
traj = collect(ZigZagBoomerang.discretize(trace, dt))

# サンプルの表示

plot_1dtraj(traj, title="1D ZigZag Sampler (Cauchy distribution)")
```

